import React from 'react'
import './Projects.css'
import { ProjectData } from './ProjectData'

const Projects = () => {
  console.log(ProjectData)
  return (
    <div>
      <h1>My Projects</h1>
      {ProjectData.map(project => (
        <div key={project.id}>
          <h1>{project.name}</h1>
          <p>{project.description}</p>
          <img alt='project' src={project.img}></img>
        </div>
      ))}
    </div>
  )
}

export default Projects
